const PlayerRow = () => {
  return (
    <div className="my-1 d-flex flex-row justify-content-between align-items-center text-center border-bottom border-2 border-dark">
      {/* Left Row */}
      <div className="p-1 ms-1 mb-1">Player</div>
      {/* Right Row */}
      <div className="d-flex flex-row me-1 mb-1">
        {/* Minus Sign */}
        <div className="py-1 px-3 bg-danger rounded">-</div>
        {/* Damage Total */}
        <div className="p-1">0</div>
        {/* Plus Sign */}
        <div className="py-1 px-3 bg-success rounded">+</div>
      </div>
    </div>
  );
};

export default PlayerRow;
